import React, { Component } from 'react';
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import CardActions from '@mui/material/CardActions';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';
import TextField from '@mui/material/TextField';
import RadioGroup from '@mui/material/RadioGroup';
import FormControlLabel from '@mui/material/FormControlLabel';
import Radio from '@mui/material/Radio';
import Checkbox from '@mui/material/Checkbox';
import Select from '@mui/material/Select';
import MenuItem from '@mui/material/MenuItem';
import TextareaAutosize from '@mui/material/TextareaAutosize';
import Avatar from '@mui/material/Avatar';
import './SignUpPage.css';

import axios from 'axios';


class SignUpPage extends Component {

    constructor(props) {
        super(props);
        this.state = {
            employeeName: '',
            profilePic: '',
            gender: '',
            department: '',
            salary: '',
            notes: ''

        }
    }

    handleEmpName = (event) => {
        this.setState({
            employeeName: event.target.value
        })
    }

    handleProfile = (event) => {
        this.setState({
            profilePic: event.target.value
        })
    }

    handleGender = (event) => {
        this.setState({
            gender: event.target.value
        })
    }

    handleDepartment = (event) => {
        this.setState({
            department: event.target.value
        })
    }

    handleSalary = (event) => {
        this.setState({
            salary: event.target.value
        })
    }

    handleNote = (event) => {
        this.setState({
            notes: event.target.value
        })
    }

    handleSubmit = async (e) => {

        // console.log(this.state);

        await axios.post("http://localhost:8080/registerEmployee", this.state).then((response)=>{
            console.log(response.data)}).catch((error)=>{

           console.log(error.response.data.message);
        })

        alert("Emplyee Added")
    }



    render() {
        return(
            <div>
            <Card className='form_card' variant="outlined">
                <CardContent>
                <Typography className="TableTitle" variant="h5" component="div">
                    Registration Form
                </Typography>
                {/* <form className='form'> */}
                <div className='field_container'>

                    <div>
                        <label className='emp-name-field' > First Name </label>
                         <div >
                            <TextField required className='name-box' variant="outlined" onChange={(event)=>this.handleEmpName(event)} value={this.state.employeeName} />
                        </div> 

                    </div> 

                    </div>
                <div>
                <label className='emp-name-field'>Last Name</label>
                <div >
                    <TextField required className='name-box' variant="outlined" onChange={(event)=>this.handleEmpName(event)} value={this.state.employeeName} />
                 </div> 
               </div>
               <div>
                <label className='emp-name-field'>Address</label>
                <div >
                    <TextField required className='name-box' variant="outlined" onChange={(event)=>this.handleEmpName(event)} value={this.state.employeeName} />
                 </div> 
               </div>
               <div>
                <label className='emp-name-field'>Phone Number</label>
                <div >
                    <TextField required className='name-box' variant="outlined" onChange={(event)=>this.handleEmpName(event)} value={this.state.employeeName} />
                 </div> 
               </div>
               <div>
                <label className='emp-name-field'>Password</label>
                <div >
                    <TextField required className='name-box' variant="outlined" onChange={(event)=>this.handleEmpName(event)} value={this.state.employeeName} />
                 </div> 
               </div>




                <CardActions className="action_container">
                    <div><Button variant="outlined" className="action_button">Cancel</Button></div>
                    <div>
                    <Button variant="contained" className="submit" onClick={this.handleSubmit}>Submit</Button>
                        <Button variant="outlined" type="reset" className="action_button" onClick={this.reset}>Reset</Button>
                    </div>


                </CardActions>
                {/* </form> */}
                </CardContent>

            </Card> 
            </div> 
        )
    }
}

export default SignUpPage;
